import React from 'react'
import { useState } from 'react';
import './classes.css'

function Classes({informationPage}) {

    const [isListVisible, setListVisible] = useState(Array(informationPage.classes.length).fill(false));

    const toggleList = (index) => {
        const updateList = [...isListVisible]
        updateList[index] = !updateList[index]
        setListVisible(updateList)
    };
    

  
  return (
    <div className='labels'>
        <iframe
        src="https://carbon.now.sh/embed?bg=rgba(74%2C144%2C226%2C1)&t=vscode&wt=none&l=auto&width=680&ds=false&dsyoff=20px&dsblur=68px&wc=true&wa=true&pv=56px&ph=56px&ln=false&fl=1&fm=Fira+Code&fs=14px&lh=152%25&si=false&es=1x&wm=false&code=package%2520com.dambroski.foodDeliveryProject.User%253B%250A%250Aimport%2520java.util.Date%253B%250Aimport%2520java.util.List%253B%250Aimport%2520java.util.Set%253B%250A%250Aimport%2520javax.persistence.CascadeType%253B%250Aimport%2520javax.persistence.Column%253B%250Aimport%2520javax.persistence.Entity%253B%250Aimport%2520javax.persistence.FetchType%253B%250Aimport%2520javax.persistence.GeneratedValue%253B%250Aimport%2520javax.persistence.GenerationType%253B%250Aimport%2520javax.persistence.Id%253B%250Aimport%2520javax.persistence.OneToMany%253B%250Aimport%2520javax.validation.constraints.Past%253B%250A%250Aimport%2520org.springframework.format.annotation.DateTimeFormat%253B%250A%250Aimport%2520com.dambroski.foodDeliveryProject.Address.Address%253B%250Aimport%2520com.dambroski.foodDeliveryProject.security.Authority%253B%250Aimport%2520com.fasterxml.jackson.annotation.JsonFormat%253B%250Aimport%2520com.fasterxml.jackson.annotation.JsonIgnore%253B%250Aimport%2520com.fasterxml.jackson.annotation.JsonIgnoreProperties%253B%250A%250Aimport%2520lombok.AllArgsConstructor%253B%250Aimport%2520lombok.Builder%253B%250Aimport%2520lombok.Data%253B%250Aimport%2520lombok.NoArgsConstructor%253B%250A%250A%2540Entity%250A%2540Data%250A%2540AllArgsConstructor%250A%2540NoArgsConstructor%250A%2540Builder%250Apublic%2520class%2520User%2520%257B%250A%2509%250A%2509%2540Id%250A%2509%2540GeneratedValue(generator%2520%253D%2520%2522user_id%2522%252Cstrategy%2520%253D%2520GenerationType.AUTO)%250A%2509%2540Column(name%2520%253D%2520%2522user_id%2522)%250A%2509private%2520Long%2520userId%253B%250A%2509private%2520String%2520name%253B%250A%2509private%2520String%2520pwd%253B%250A%2509private%2520String%2520email%253B%250A%2509%250A%2509%2540Past(message%2520%253D%2520%2522Birth%2520date%2520must%2520be%2520in%2520the%2520past%2522)%250A%2509%2540JsonFormat(shape%2520%253D%2520JsonFormat.Shape.STRING%2520%252Cpattern%2520%253D%2520%2522yyyy-MM-dd%2522)%250A%2509%2540DateTimeFormat(pattern%2520%253D%2520%2522yyyy-MM-dd%2522)%250A%2509private%2520Date%2520birthDate%253B%250A%2509%252F%252Fadd%2520%2540size%2520%250A%2509private%2520String%2520code%253B%250A%2509%250A%2509private%2520String%2520role%253B%250A%2509%250A%2509%2540JsonIgnoreProperties(%257B%2522type%2522%252C%2522typeId%2522%257D)%250A%2509%2540OneToMany(cascade%2520%253D%2520CascadeType.ALL%252Cfetch%2520%253D%2520FetchType.EAGER)%250A%2509private%2520List%253CAddress%253E%2520addresses%253B%250A%2509%250A%2509%2540JsonIgnore%250A%2509%2540OneToMany(mappedBy%2520%253D%2520%2522user%2522%252Cfetch%2520%253D%2520FetchType.EAGER)%250A%2509private%2520Set%253CAuthority%253E%2520authorities%253B%250A%2509%250A%2520%2520%257D%250A%250A"
        style="width: 764px; height: 1707px; border:0; transform: scale(1); overflow:hidden;"
        sandbox="allow-scripts allow-same-origin">
        </iframe>
        {informationPage.classes.map((item,index) => 
            
            <>
                <label onClick={() => toggleList(index)}>
                    {item}
                </label>
                {isListVisible[index] && (

                    <div className='method-table'>
                        <table>
                            <tr>
                                <th>Method</th>
                                <th>URl</th>
                                <th>description</th>
                            </tr>
                            {informationPage.methods[index].map((object, subIndex) =>
                                <tr key={subIndex}>
                                    <td>{object.method}</td>
                                    <td>{object.URL}</td>
                                    <td>{object.description}</td>
                                </tr>    
                            )}
                        </table>
                    </div>
                    
                   
                )}   
            </>
            
        )} 
        
    </div>
  )
}

export default Classes
